import { StyleSheet, Text, View } from 'react-native'
import React from 'react'

const HomeRecruiter = () => {
  return (
    <View>
      <Text>HomeRecruiter</Text>
    </View>
  )
}

export default HomeRecruiter

const styles = StyleSheet.create({})
